const listStyles = {
    marginBottom: 96,
    paddingLeft: 0,
  }

export default function RecipeGallery({list}) {
    return (
        <ul style={listStyles}>
           {list.map(recipe => {
            <li key = {recipe.id}>
            {recipe.title} : {recipe.ingredients} 
            </li>} )}
        </ul>
    );
}
